(1, 'The Meeting of The Last Hour', 'This is the complete session of our last meeting with the ceo									\r\n											', 'Physics', 'Hadiza Oyiza Muhammed', 'hadizamuhammed@abumail.com', '2015-02-02', 'The Meeting of The Last Hour This is the complete session of our last meeting with the ceo 2015-02-02\nPhysics hadizamuhammed@abumail.com', '1', 'P1000001u1234567M8'),
(2, 'My Project Write Up - Online PUTME and Result Checking Registration Portal', 'As the name implies online Post Utme registration and result checking system is a web based software developed for the registration of entrance examination in to the Federal Polytechnic Idah. For the past few years, candidate applying to study in the higher institutions have rapidly increased. For this reason, there is need to develop a web based management system to enhance the speedy development of the registration activities in the institution. 									\r\n											', 'Physics', 'Hadiza Oyiza Muhammed', 'hadizamuhammed@abumail.com', '2015-02-02', 'My Project Write Up - Online PUTME and Result Checking Registration Portal As the name implies online Post Utme registration and result checking system is a web based software developed for the registration of entrance examination in to the Federal Polytechnic Idah. For the past few years, candidate applying to study in the higher institutions have rapidly increased. For this reason, there is need to develop a web based management system to enhance the speedy development of the registration activities in the institution. 									\n											 Physics hadizamuhammed@abumail.com', '1', 'P1000002u1234567M8'),
(3, 'APC Presidential Rally In Kano', 'This are the true fans of Gen. Muhammadu Buhari Presidential Rally In Kano.\r\nIt seems the change we want is every where.\r\nMay Allah Bring Us The Change.									\r\n											', 'Physics', 'Hadiza Oyiza Muhammed', 'hadizamuhammed@abumail.com', '2015-02-03', 'APC Presidential Rally In Kano This are the true fans of Gen. Muhammadu Buhari Presidential Rally In Kano.\nIt seems the change we want is every where.\nMay Allah Bring Us The Change	 Physics hadizamuhammed@abumail.com Hadiza Oyiza Muhammed 03/02/2015', '1', 'P1000003u1234567M8'),
(4, 'Pesoka Computers Windows Practical Hand Out', 'This is the Hand Out Practical on Windows For Pesoka Computers Training Insttute Ajaokuta									\r\n											', 'Physics', 'Hadiza Oyiza Muhammed', 'hadizamuhammed@abumail.com', '2015-02-03', 'Pesoka Computers Windows Practical Hand Out This is the Hand Out Practical on Windows For Pesoka Computers Training Insttute Ajaokuta Physics hadizamuhammed@abumail.com Hadiza Oyiza Muhammed 03/02/2015', '1', 'P1000004u1234567M8'),
(5, 'Sollution to Assignment on EED 112 (Ellectrical Electronics Nature) ', 'This is the solution to the assignment of EED 112 By Prof Wale Adejomoh	\r\nEnjoy Yourself.								\r\n											', 'Physics', 'Jimoh Oziohu Isah', 'jimohisahu1234567@abumail.com', '2015-02-03', 'Sollution to Assignment on EED 112 (Ellectrical Electronics Nature)  This is the solution to the assignment of EED 112 By Prof Wale Adejomoh	\nEnjoy Yourself. Physics jimohisahu1234567@abumail.com Jimoh Oziohu Isah 03/02/2015', '1', 'P1000005u1234567'),
(6, 'Nigeria and Political Jingoism in towards 2015 Election', '<p>this is the pure abstract of Nigeria and its political immenses taken and drive from all the geopolitical zones in the country towards the meangle of june 2015 ellection.</p>\n\n<p>All research by me.</p>', 'Physics', 'Jimoh Oziohu Isah', 'jimohisahu1234567@abumail.com', '2015-02-08', 'Nigeria and Political Jingoism in towards 2015 Election <p>this is the pure abstract of Nigeria and its political immenses taken and drive from all the geopolitical zones in the country towards the meangle of june 2015 ellection.</p>\r\n\r\n<p>All research by me.</p> Physics jimohisahu1234567@abumail.com Jimoh Oziohu Isah 08/02/2015', '1', 'P1000006u1234567');
